  ldr     x6, =0x10e00
  ldrb    w9, [x28, FLAGS2-sysvars]
  mov     x10, 'K'
  nzcv    #0b0110
  ret


cl_chan_3c_setup:
  _strb   0x3c, DF_SZ
  _strb   0x6f, BORDCR
  _strb   0b11110011, P_FLAG
  _strh   0x0001, STRMS                           // Stream -3 points to first channel
  _str    heap, CHANS                             // [CHANS] = start of heap
  _str    'K', heap+0x10                          // Set channel identifier for first channel
  ret

cl_chan_3c_effects:
  _str    heap, CURCHL                            // Current channel is keyboard
  _resbit 1, FLAGS                                // Printer not in use
  _resbit 5, FLAGS                                // No new key
  _setbit 4, FLAGS2                               // K channel in use
  _setbit 0, TV_FLAG                              // Lower screen in use
  _strb   0x6f, ATTR_T                            // [BORDCR]
  _strb   0x00, MASK_T
  _strb   0b10100010, P_FLAG                      // even (temp) bits cleared
  _str    print_out, heap
  _str    key_input, heap+8
  _strb   109, S_POSN_X_L
  _strb   59, S_POSN_Y_L
  _strb   109, ECHO_E_X
  _strb   59, ECHO_E_Y
  _str    (display_file + 0x00d8), DF_CC_L
  ret

cl_chan_3c_effects_regs:
  mov     x0, #59
  mov     x1, #109
  adr     x2, (display_file + 0x00d8)
  ldrb    w3, [x28, TV_FLAG-sysvars]
  mov     x4, #1
  mov     x5, #216
  ldr     x6, =0x10e00
  ldrb    w9, [x28, FLAGS2-sysvars]
  mov     x10, 'K'
  nzcv    #0b0110
  ret
